script: |
  super -f tsv -I q3255.sql | sort > q3255.out

vector: true

inputs:
  - name: q3255.sql
    data: |
      SELECT DISTINCT * FROM tab1 AS cor0 WHERE NOT - col1 - col1 * - col0 NOT BETWEEN - cor0.col2 + col1 AND NULL OR - col2 + + col2 * col1 NOT BETWEEN NULL AND + col1 - col0;
  - name: tab1

outputs:
  - name: q3255.out
    data: |
      3	26	54
      64	10	57
      80	13	96
